export default {
	name: 'Video',
	props: {
		title: {
			type: String,
			default: '查看视频'
		},
		userName: {
			type: String,
			default: ''
		},
		roundNo: {
			type: String,
			default: ''
		},
		value: { type: Boolean, default: false },
		src: {
			type: String,
			default: ''
		}
	},
	data() {
		return {
			key: +new Date(),
			newsrc: ''
		}
	},
	watch: {
		src(val) {
			this.newsrc = val
		}
	},
	methods: {
		handleClose() {
			this.$emit('input', false)
			this.$emit('clearSrc')
			this.newsrc = ''
			this.key = +new Date()
		}
	}
}
